  summary: "\nThe number of squares for which the solver had to guess while finding a solution.\n"
  remarks: "\nUnlike <xref href=\"SudokuSpice.Data.SolveStats.NumTotalGuesses\" data-throw-if-not-resolved=\"false\"></xref>, if the solver was\nsetting a square that had three possible values, this would only add 1 to\n<code>NumSquaresGuessed</code>. If NumSolutionsFound is greater than 1, then the precise\nmeaning of this value is undefined.\n"
